import React from "react";
import nba from "nba";

function TeamSearchBar() {
  return (
    <section className="TeamSearchBar" style={{ display: "flex" }}>
      {nba.teams.map(item => (
        <>
          <div style={{ height: 50, width: 50 }}>
            src=
            {`https://www.nba.com/stats/media/img/teams/logos/${item.abbreviation}_logo.svg`}
          </div>
        </>
      ))}
    </section>
  );
}

export default TeamSearchBar;
